      "snippet": {
        "videoId": "TUJWx7vo44c",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "hmOhQGpiKQWHDuBZKmdxWLQ2E9E",
          "id": "UgzzMmG8kKAzxWF5wGN4AaABAg",
          "snippet": {
            "videoId": "TUJWx7vo44c",
            "textDisplay": "Ewan: That lightsaber belonged to Alec Guiness. \u003cbr\u003e\u003cb\u003eEmotional silence\u003c/b\u003e\u003cbr\u003eGraham: Oh... Then it&#39;s yours.\u003cbr\u003e\u003cb\u003eEwan accepts it\u003c/b\u003e\u003cbr\u003eI dramatized it but this might be the best moment in TV history.",
            "textOriginal": "Ewan: That lightsaber belonged to Alec Guiness. \n*Emotional silence*\nGraham: Oh... Then it's yours.\n*Ewan accepts it*\nI dramatized it but this might be the best moment in TV history.",
            "authorDisplayName": "Domasiukas",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu_0sJ9DnrbBHFUg4BN4JuuizqfTuSwb8jBwtw=s48-c-k-c0x00ffffff-no-rj",
            "authorChannelUrl": "http://www.youtube.com/channel/UCixiL7Oy6AYCz-48gMoA3Yw",
